import React from 'react';
import Button from "@mui/material/Button";

export const ButtonComponent = () => {
    return (
        <div>
         <Button style={{maxWidth: '50px', maxHeight: '40px', minWidth: '40px', minHeight: '40px',marginLeft:'20px',background:'aquamarine',marginTop:'20px'}}
                 variant="outlined" size="large"/>
        </div>
    );
};
